Lenovo Thinkpad T16" R7-6850U/Lte Предзаказ.

Предзаказ: 

1. Экран 300 нит fullhd/R7-6850U/16GB/512GB ssd/RX 680M =98 800 руб. 
2. Экран 400 нит 2,5K/R7-6850U/16GB/1TB ssd/RX 680M = 139 800 руб. 
3. Экран 400 нит 2,5K/R5-6650U/32GB/1TB ssd/RX 680M = 139 800 руб. 

В Наличии? 

Предзаказ 16-24 рабочих дня, предоплата 50%. 

Состояние Ноутбука? 

Запечатанный. Бесплатная доставка по РФ. 

Гарантия? 

Официальная гарантия Lenovo, 2 года в РФ. 

Характеристики: 

Экран: 16.0" Wuxga (1920 x 1200) Ips, anti-glare, 300 nits, матовый 16:10;

Процессор: Amd Ryzen 7 Pro 6850U (2,70 ггц, максимальное ускорение до 4,70 ггц, 8 ядер, 16 потоков, кэш 16 МБ);
Память: 16GB Ddr5 6400mhz (распаяна);
Накопитель: Pcie 4.0 512GB Ssd Nvme (upgrade до 4TB) +свободный слот для 4G Lte модуля +1TB onedrive;
Видео: RX 680M 2200 mhz/12 ядер, как geforce Gtx 1650 Max-Q;
Порты фото №7: 

— 2 x Usb-C 3.2 Gen 2;
— 2 x Usb-A 3.2 Gen 1;
— Hdmi 2.0b;
— Headphone / mic combo;
— RJ45;
— Sim. 
Батарея: 52,5whr (7-9 часов работы), поддерживает быструю зарядку 50% за 30 минут;
Дополнительно: Вес 1,64кг, 20мм толщина. Подсветка клавиатуры, приятный ход клавиш, Qualcomm Wi-Fi 6E в 3 раза быстрее пятой версии, интеллектуальное шумоподавление. Веб-Камера с ИК с функцией время видеозвонков. Dollby Audio/Voice. Военный стандарт 810H.

Upgrade: 

— Если заменить pcie 4.0 512GB на M2 Ssd Samsung Pm9a1 (980 Pro): 
— 1TB +8 800 руб;
— 2TB +15 800 руб;
— Если pcie 3.0 -30% от цен выше. 

— Если добавить Pm9a1 (980 Pro): 
— 500GB pcie 3.0 +4900 руб;
— 1TB +10 800 руб;
— 2Tb +18 800 руб. 

X5 Подарков входят в цену: 

1. Лицензия настоящая с привязкой к аккаунту навсегда Office 2021, (Word, Excel, Power Point) для Windows или подписка Office 365 на 1 год на 5 устройствах (Android, ios, Mac, Windows) +1TB облачного хранилища в onedrive и +премиальные шаблоны у любого offica;

2. Лицензия с привязкой: Windows 11 Home предустановлена, Win 11 Pro, Enterprise, Ltsc;

3. Лазерная русификация клавиатуры с подсветкой в РФ, заводское качество, буквы подсвечиваются, фото №5-6;

4. Чехол конверт из шерсти/нубука или рюкзак/сумка для ноутбука;

5. Русская вилка для зарядки 2шт. 

Гарантия 2 Года В РФ: 

1) Бесплатный ремонт в СЦ Lenovo по всей России, более 4 лет выполняю гарантийные обязательства, более 300 отзывов тому подтверждение. 

2) Но если не будет запчастей в РФ, то гарантийный ремонт производителя, всегда в наличии запчасти и лучший ремонт в сравнении с РФ. Оказываю полное сопровождение с бесплатной доставкой РФ-Завод-РФ;

3) Не гарантийный ремонт, а механическое воздействие, чаще бывает у покупателей: заказ оригинальных запчастей со скидкой~ от 40 до 80% от цены РФ и установка в СЦ Lenovo. 

Возврат: 7 дней для возврата товара ненадлежащего качества. 

Проверки Перед Покупкой с диагностическими программами Aida64, Cpu‑Z, Furmark, crystaldiskinfo, Монитор Тест. 

Где Посмотреть И Проверить: в Санкт-Петербурге в удобное для вас время, есть доставка.

Для жителей остальной части РФ — Безопасная доставка Авито в ваш населённый пункт, проверки на видео перед отправкой по запросу. Бесплатный возврат, оплата кредиткой, чек. 

Поддержка Клиентов Бесплатно: удалённо или заранее установлю драйверы, любой язык, программы. Ноутбук будет готов к работе. 

Конкуренты: matebook D 16 от Huawei и Vivobook Pro 16X от Asus. Latitude 15 5531 от Dell и HP elitebook 865 G9.

Экран и модель T14" смотрите в моём профиле.

